(async function () {
    try {
        const response = await fetch('/api/products'); // Modifier selon l'endpoint réel
        const products = await response.json();

        // Vérifier si la réponse est valide et contient des produits
        if (!Array.isArray(products) || products.length === 0) {
            console.error("Aucun produit trouvé ou erreur dans l'API.");
            return;
        }

        // Récupérer le nombre de produits en base de données
        const dbCountResponse = await fetch('/api/products/count'); // Endpoint à vérifier
        const dbCount = await dbCountResponse.json();

        if (!dbCount || isNaN(dbCount.total)) {
            console.error("Impossible de récupérer le nombre exact de produits en BDD.");
            return;
        }

        // S'assurer que le nombre affiché correspond exactement au nombre en BDD
        const exactProducts = products.slice(0, dbCount.total); // Tronquer si besoin

        // Injecter les produits filtrés dans le DOM
        renderProducts(exactProducts);

    } catch (error) {
        console.error("Erreur lors du chargement des produits :", error);
    }
})();

// Fonction qui affiche les produits dans le DOM
function renderProducts(products) {
    const container = document.getElementById("product-list");
    if (!container) return;

    container.innerHTML = products.map(product => `
        <div class="product-card">
            <h3>${product.nom}</h3>
            <p>${product.description}</p>
            <span>Prix: ${product.prix}€</span>
        </div>
    `).join("");
}
